to tweak the `-lpthread` and such annotations as well as the name of the
`libwasmtime.a` file on Windows.
*/ #include <assert.h>
#include <stdio.h>
#include <stdlib.h>
#include <wasm.h>
#include <wasmtime.h> static void exit_with_error(const char *message, wasmtime_error_t *error, wasm_trap_t *trap); static wasm_trap_t* hello_callback(const wasm_val_t args[], wasm_val_t results[]) { printf("Calling back...\n"); printf("> Hello World!\n"); return NULL;
} int main() { int ret = 0; // Set up our compilation context. Note that we could also work with a // `wasm_config_t` here to configure what feature are enabled and various // compilation settings. printf("Initializing...\n"); wasm_engine_t *engine = wasm_engine_new(); assert(engine != NULL); // With an engine we can create a *store* which is a long-lived group of wasm // modules. wasm_store_t *store = wasm_store_new(engine); assert(store != NULL); // Read our input file, which in this case is a wasm text file. FILE* file = fopen("examples/hello.wat", "r"); assert(file != NULL); fseek(file, 0L, SEEK_END); size_t file_size = ftell(file); fseek(file, 0L, SEEK_SET); wasm_byte_vec_t wat; wasm_byte_vec_new_uninitialized(&wat, file_size); assert(fread(wat.data, file_size, 1, file) == 1); fclose(file); // Parse the wat into the binary wasm format wasm_byte_vec_t wasm; wasmtime_error_t *error = wasmtime_wat2wasm(&wat, &wasm); if (error != NULL) exit_with_error("failed to parse wat", error, NULL); wasm_byte_vec_delete(&wat); // Now that we've got our binary webassembly we can compile our module. printf("Compiling module...\n"); wasm_module_t *module = NULL; error = wasmtime_module_new(engine, &wasm, &module); wasm_byte_vec_delete(&wasm); if (error != NULL) exit_with_error("failed to compile module", error, NULL); // Next up we need to create the function that the wasm module imports. Here // we'll be hooking up a thunk function to the `hello_callback` native // function above. printf("Creating callback...\n"); wasm_functype_t *hello_ty = wasm_functype_new_0_0(); wasm_func_t *hello = wasm_func_new(store, hello_ty, hello_callback); // With our callback function we can now instantiate the compiled module, // giving us an instance we can then execute exports from. Note that // instantiation can trap due to execution of the `start` function, so we need // to handle that here too. printf("Instantiating module...\n"); wasm_trap_t *trap = NULL; wasm_instance_t *instance = NULL; cons